import React from 'react';
import { AppBar, Box, CssBaseline,  makeStyles, Toolbar, Typography } from '@material-ui/core';
import {Link} from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    boxShadow:"#e05929",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function Header() {
    //#e05929;
    const classes = useStyles();
    return(
        <div className={classes.root}>
            <CssBaseline/>
            <AppBar positon="static">
                <Toolbar>
                    <Typography variant="h6" noWrap >
                        HCA Healthcare Video Library
                    </Typography>
                    <Link to="/"style={{ color: 'inherit', textDecoration: 'inherit'}}>
                      <Typography variant="h6" textAlign="center">Covid Videos</Typography>
                    </Link>
                    <Link to="/:otherVideos" style={{ color: 'inherit', textDecoration: 'inherit'}}>
                      <Typography variant="h6" textAlign="center">Other Videos</Typography>
                    </Link>
                </Toolbar>

            </AppBar>
        </div> 
    );
}
